var radarChart = new Chart(document.getElementById("radar-chart"),config);

function changeData(){
  config.data.datasets[0].data = newData;
  radarChart.update();
}

function searchPokemon(){
  var searchedPokemon = document.getElementById("entry-search").value;
  for(var pokemon of dataJson){
    if (pokemon.Name.toLowerCase().startsWith(searchedPokemon.toLowerCase())){
    //if (pokemon.Name.toLowerCase() == searchedPokemon.toLowerCase()){
      setPokemon(pokemon);
      break;
    }
  }
}

function setPokemon(pokemon){
  currentPokemon = pokemon;
  updateRadarChart();
  updateInfoPanel();
}

function getStatsList(){
  var stats = [
    currentPokemon.HP,
    currentPokemon.Attack,
    currentPokemon.Defense,
    currentPokemon["Sp. Atk"],
    currentPokemon["Sp. Def"],
    currentPokemon.Speed
  ];
  return stats;
}

function getCurrentPokemonName(){
  return currentPokemon.Name;
}

function getCurrentPokemonNumber(){
  return currentPokemon[" Number"];
}
function getCurrentPokemonGen(){
  return currentPokemon.Generation;
}

function getCurrentPokemonUrl(){
  return currentPokemon.url;
}

function getCurrentPokemonHue(){
  return currentPokemon.hue;
}

function getCurrentPokemonType(){
  return currentPokemon["Type 1"];
  // add secondary type maybe
}

function updateRadarChart(){
  var newData = getStatsList();
  var currentPokemonName = getCurrentPokemonName();
  config.data.datasets[0].data = newData;
  config.data.datasets[0].label = currentPokemonName;
  config.options.title.text = currentPokemonName;
  radarChart.update();
}

function updateInfoPanel() {
  document.getElementById("info-name").innerText = getCurrentPokemonName();
  document.getElementById("info-number").innerText = "N° "+getCurrentPokemonNumber();
  document.getElementById("info-type").innerText = "Type: "+getCurrentPokemonType();
  document.getElementById("info-gen").innerText = "Gen: "+getCurrentPokemonGen();
  document.getElementById("info-sprite").setAttribute("src",getCurrentPokemonUrl());
}

function convertToCartissianCoordinates(radius,degrees){
  var angle = -degreesToRadians(degrees + 180);
  return {x:radius*Math.sin(angle),y:radius*Math.cos(angle)};
}

function degreesToRadians(degrees){
  return degrees * Math.PI / 180;
}

function placeDot(radius,angle,pokemon){
  var coordinates = convertToCartissianCoordinates(radius,angle);
  var colorWheelPanel = document.getElementById("color-wheel-panel");
  var dot = document.createElement("div");
  dot.onmouseover = () => {
    setPokemon(pokemon);
  }
  dot.classList.add("pokemon-dot");
  dot.style.left = coordinates.x + 173;
  dot.style.bottom = coordinates.y + 173;
  colorWheelPanel.appendChild(dot);
  dots.push(dot);
}

function getRadius(pokemon){
  var selectStats = document.getElementById("select-stats").value;

  switch(selectStats){
    case "hp":
      return  165-(pokemon.HP/maxStats.hp*150); 
    case "attack":
      return  165-(pokemon.Attack/maxStats.attack*150); 
    case "defense":
      return  165-(pokemon.Defense/ maxStats.defense*150);
    case "spAtk":
      return  165-(pokemon["Sp. Atk"]/ maxStats["spAtk"]*150);
    case "spDef":
      return 165-(pokemon["Sp. Def"]/maxStats["spDef"]*150);
    default:
      return 165-(pokemon.Total/maxStats.total*150);
  }
}

function placeDots(){
  var selectedGen = document.getElementById("select-gen").value;
  for(var pokemon of dataJson){
    if((pokemon.Generation == selectedGen || selectedGen == "all") 
      && (selectedType == pokemon["Type 1"].toLowerCase() || selectedType == pokemon["Type 2"].toLowerCase() || selectedType == "all")){
      placeDot(getRadius(pokemon),parseInt(pokemon.hue),pokemon);
    }
    
  }
}

function refreshDots(){
  removeDots();
  placeDots();
}

function selectType(type){
  selectedType = type;
  refreshDots();
}

function removeDots(){
  for(var dot of dots){
    dot.parentNode.removeChild(dot);
  }
  dots = [];
}

placeDots();
